Machined Reborn (2009)

Verenigde Staten
Horror
80 minuten

geregisseerd door Craig McMahon
met Kathleen Benner, Russell Clay en David C. Hayes

Wanneer een woning in de Sanoranwoestijn in Arizona niet meer betaald kan worden, gaat men voor een openbare veiling van het pand. Een enthousiast jong koppeltje is in de gelegenheid om het huis te kopen. Maar wat zij niet weten is dat het eigendom was van een seriemoordenaar, de 'Motorman Dan', wiens misdaden de meest raadselachtige in de Amerikaanse geschiedenis waren. En nu worden hun wittebroodsweken een gruwelijke halt toegeroepen, als de Motorman opnieuw opstaat voor een rondje van nog meer terreur.


